import { Container } from 'react-bootstrap';
import { Row } from 'react-bootstrap';


const Location = () => {
return (
    <section id="anfahrt" className="locationSection">
        <Container>
            <Row>
                <h2 style={{textAlign: "center"}}>Anfahrt</h2>
            </Row>
        </Container>
    </section>
)
   
}

export default Location;
